define({"topics" : [{"title":"Supported Versions","id":"concept_n4q_lgj_ybb","href":"datacollector\/UserGuide\/Installation\/MapR-Prerequisites.html#concept_n4q_lgj_ybb","menu": {"hasChildren":false,},"tocID":"concept_n4q_lgj_ybb-d46e5316","topics":[]},{"title":"Step 1. Install Client Libraries","id":"concept_wcb_lxp_xz","href":"datacollector\/UserGuide\/Installation\/MapR-Prerequisites.html#concept_wcb_lxp_xz","menu": {"hasChildren":false,},"tocID":"concept_wcb_lxp_xz-d46e5338","topics":[]},{"title":"Step 2. Run the Command to Set Up MapR","shortdesc":"\n               <p class=\"shortdesc\">After installing the required client libraries, run the <code class=\"ph codeph\">setup-mapr</code>         command. The command modifies configuration files, creates the required symbolic links, and         installs the\n                  appropriate MapR stage libraries. You can run the command in interactive or         non-interactive mode. \n               </p>\n            ","id":"concept_pvx_wxp_xz","href":"datacollector\/UserGuide\/Installation\/MapR-Prerequisites.html#concept_pvx_wxp_xz","menu": {"hasChildren":true,},"tocID":"concept_pvx_wxp_xz-d46e5370","next":"concept_pvx_wxp_xz-d46e5370",},{"title":"Step 3. Connect to a MapR Cluster Secured with Built-in Security","shortdesc":"\n               <p class=\"shortdesc\">If the MapR cluster is enabled with built-in security, you must configure <span class=\"ph\">Data Collector</span> to         connect to a secure MapR cluster.\n               </p>\n            ","id":"concept_rt3_p5p_qcb","href":"datacollector\/UserGuide\/Installation\/MapR-Prerequisites.html#concept_rt3_p5p_qcb","menu": {"hasChildren":false,},"tocID":"concept_rt3_p5p_qcb-d46e5539","topics":[]},{"title":"Step 4. Run Data Collector as a MapR Ticket User","shortdesc":"\n               <p class=\"shortdesc\">To connect to a secure MapR cluster enabled with built-in security, ensure that a valid         user, tenant, or service ticket\n                  exists for the <span class=\"ph\">Data Collector</span> user. \n               </p>\n            ","id":"concept_kpp_4zp_fbb","href":"datacollector\/UserGuide\/Installation\/MapR-Prerequisites.html#concept_kpp_4zp_fbb","menu": {"hasChildren":false,},"tocID":"concept_kpp_4zp_fbb-d46e5618","topics":[]}]});